import React from "react";
import "./App.css";
import Usuario from "./components/cadastroUsuario";
import Veiculo from "./components/cadastroVeiculo";
import Busca from "./components/buscaVeiculo";
import { Link } from "react-router-dom";
import Navbar from "react-bootstrap/Navbar";
import Container from "react-bootstrap/Container";
import Breadcrumb from "react-bootstrap/Breadcrumb";
import Button from "react-bootstrap/Button";

const callUser = () => {
  <Usuario />;
};
const callCar = () => <Veiculo />;
const callSearch = () => <Busca />;

function App() {
  return (
    <div className="App">
      <header>
        <div>
          <Navbar bg="dark" variant="dark">
            <Container>
              <Navbar.Brand href="#home">ParkSys</Navbar.Brand>
            </Container>
            <Button variant="info" value="usuario" onClick={callUser()}>
              Usuários
            </Button>
            <Button variant="info" value="veiculo" onClick={callCar()}>
              Veículos
            </Button>
            <Button variant="info" value="buscar" onClick={callSearch()}>
              Buscar
            </Button>
          </Navbar>
        </div>
      </header>
      <main>
        <div></div>
      </main>
    </div>
  );
}

export default App;
